import CircularProgress from '@mui/material/CircularProgress';
const Loading = () => {

    return (
                <div className='fixed inset-0 w-full z-20 bg-white bg-black/50'>
                    <div className='fixed top-1/3 right-1/2'>
                        <div className='bg-black'>
                            <CircularProgress />
                        </div>
                    </div>
                </div>
    )
}
export default Loading;
